DROP TABLE IF EXISTS Genre;
create table Genre (
    GenreID INT NOT NULL,
    GenreName varchar(40) NOT NULL,

    PRIMARY KEY(GenreID)
);


DROP TABLE IF EXISTS movie_genre;
create table movie_genre (
	MovieID VARCHAR(50),
	GenreID VARCHAR(2),

  FOREIGN KEY (MovieID) REFERENCES Movie (MovieID),
  FOREIGN KEY (GenreID) REFERENCES Genre (GenreID)
);

DROP TABLE IF EXISTS actors;
create table actors (
  ActorID INTEGER NOT NULL,
	FirstName VARCHAR(50),
	LastName VARCHAR(50),
	email VARCHAR(50),
	gender VARCHAR(50),
	country VARCHAR(50),
	phone VARCHAR(50),

  PRIMARY KEY(ActorID),
  UNIQUE (Email, Phone)
);


DROP TABLE IF EXISTS starred_movies;
create table starred_movies (
	ActorID VARCHAR(50),
	MovieID VARCHAR(50),

  FOREIGN KEY (MovieID) REFERENCES Movie (MovieID),
  FOREIGN KEY (ActorID) REFERENCES actors (ActorID)
);

DROP TABLE IF EXISTS ProductionCompany;
CREATE TABLE ProductionCompany(
  studioid INTEGER NOT NULL,
	CompanyName VARCHAR(50),
	Email VARCHAR(50),
	Phone VARCHAR(50),
	Country VARCHAR(50),
	State VARCHAR(50),
	City VARCHAR(50),
	Street VARCHAR(50),

  PRIMARY KEY(studioid),
  UNIQUE(Email, Phone)
);

DROP TABLE IF EXISTS produced_by_comp;
create table produced_by_comp (
	MovieID VARCHAR(50),
	StudioID VARCHAR(50),

  FOREIGN KEY (MovieID) REFERENCES Movie (MovieID),
  FOREIGN KEY (StudioID) REFERENCES ProductionCompany (studioid)
);

DROP TABLE IF EXISTS users;
create table users (
  userid INTEGER NOT NULL,
  FirstName VARCHAR(50),
	LastName VARCHAR(50),
	email VARCHAR(50),
	password VARCHAR(50),

  PRIMARY KEY(userid),
  UNIQUE(email)
);

DROP TABLE IF EXISTS liked_movies;
CREATE TABLE liked_movies(
    movieId int NOT NULL,
    userId int NOT NULL,

    PRIMARY KEY(movieId, userId),
    FOREIGN KEY(userId) references users (userid),
    FOREIGN KEY(movieId) references Movie (movieId)
);

DROP TABLE IF EXISTS watched_movies;
CREATE TABLE watched_movies(
    movieId int NOT NULL,
    userId int NOT NULL,

    PRIMARY KEY(movieId, userId),
    FOREIGN KEY(userId) references User (userId),
    FOREIGN KEY(movieId) references Movie (movieId)
);


DROP TABLE IF EXISTS Producer;
CREATE TABLE Producer(
  producerid INTEGER NOT NULL,
	FirstName VARCHAR(50),
	LastName VARCHAR(50),
  email VARCHAR(50),
  Gender VARCHAR(50),
	Country VARCHAR(50),
  phone VARCHAR(50),

    PRIMARY KEY(producerid),
    UNIQUE(email, phone)
);


DROP TABLE IF EXISTS produced_by;
CREATE TABLE produced_by(
  movieId int NOT NULL,
  producerId int NOT NULL,

  PRIMARY KEY(movieId, producerId),
  FOREIGN KEY(producerid) references Producer(producerid),
  FOREIGN KEY(movieId) references Movie (movieId)
);

DROP TABLE IF EXISTS StreamingCompany;
CREATE TABLE StreamingCompany(
  companyid INTEGER NOT NULL,
	CompanyName VARCHAR(50),
	email VARCHAR(50),
	Phone VARCHAR(50),
	Link VARCHAR(1000),

  PRIMARY KEY(companyid),
  UNIQUE(email, phone)
);

DROP TABLE IF EXISTS streamed_movies;
CREATE TABLE streamed_movies (
    movieId int NOT NULL,
    StreamingCompanyid int NOT NULL,
    link varchar(1000),
    
    PRIMARY KEY(movieId, StreamingCompanyId),
    FOREIGN KEY(StreamingCompanyId) references StreamingCompany (CompanyId),
    FOREIGN KEY(movieId) references Movie (movieId)
);

